class GameStorage {
    static async database() {
        let db = await openDatabase("hangmanGame", "0.0.2", "Hangman data", 1*1024*1024*1024);
        db.transaction((tx) => {
            tx.executeSql("CREATE TABLE IF NOT EXISTS `user_info` (id TEXT PRIMARY KEY, value TEXT)", []);
            tx.executeSql("INSERT INTO `user_info` (id, value) VALUES (\"photo\", \"\")", []);

            tx.executeSql("CREATE TABLE IF NOT EXISTS `estatisticas` (desc TEXT PRIMARY KEY, valor INT)", []);
            tx.executeSql("INSERT INTO `estatisticas` (desc, valor) VALUES (\"vitorias\", 0)", []);
            tx.executeSql("INSERT INTO `estatisticas` (desc, valor) VALUES (\"derrotas\", 0)", []);

            tx.executeSql("CREATE TABLE IF NOT EXISTS `conquistas` (id INTEGER PRIMARY KEY)", []);
        });
        return db;
    }
    static async setUserPhoto(base64data){
        let db = await this.database();
        db.transaction((tx) => {
            tx.executeSql("UPDATE `user_info` SET value = '"+base64data+"' WHERE id = 'photo'", []);
        });
    }
    static async win() {
        this.addFirstAchievements(true).then(async ()=> {
            let db = await this.database();
            db.transaction((tx) => {
                tx.executeSql("UPDATE `estatisticas` SET valor = valor + 1 WHERE desc = 'vitorias'", []);
            });
        });
    }
    static async lose() {
        this.addFirstAchievements(true).then(async ()=> {
            let db = await this.database();
            db.transaction((tx) => {
                tx.executeSql("UPDATE `estatisticas` SET valor = valor+1 WHERE desc = 'derrotas'", []);
            });
        });
    }
    static async addFirstAchievements(win){
        let {wins, loses} = await this.getWinsAndLoses();
        if(wins+loses==0) this.achievementFirstTime();
        if(wins+loses==9) this.achievementTenTimes();
        if(wins+loses==49) this.achievementFifthTimes();
        if(wins+loses==99) this.achievementHundredTimes();
        if(wins==0&&win) this.achievementFirstWin();
        if(wins==9&&win) this.achievementTenWins();
        if(wins==49&&win) this.achievementFifthWins();

    }
    static async addAchievement(id) {
        let db = await this.database();
        db.transaction((tx) => {
            tx.executeSql("INSERT INTO `conquistas` (id) VALUES ("+id+")", []);
        });
    }
    static async achievementFirstTime() { await this.addAchievement(1); }
    static async achievementFirstWin() { await this.addAchievement(2); }
    static async achievementTenWins() { await this.addAchievement(8); }
    static async achievementFifthWins() { await this.addAchievement(9); }
    static async achievementThatWasClose() { await this.addAchievement(3); }
    static async achievementVeryEasy() { await this.addAchievement(4); }
    static async achievementTenTimes() { await this.addAchievement(5); }
    static async achievementFifthTimes() { await this.addAchievement(6); }
    static async achievementHundredTimes() { await this.addAchievement(7); }

    static async getUserPhoto(callback) {
        let db = await this.database();
        return new Promise((resolve, reject) => {
            db.transaction((tx) => {
                tx.executeSql("SELECT * FROM `user_info` WHERE id = 'photo'", [], (tx, data) => resolve(data.rows[0].value));
            });
        });
    }
    static async getWinsAndLoses(callback) {
        let db = await this.database();
        return new Promise((resolve, reject) => {
            db.transaction((tx) => {
                tx.executeSql("SELECT desc, valor FROM `estatisticas` WHERE desc = 'vitorias' OR desc = 'derrotas'", [], (tx, data) => {
                    let answer = {
                        wins: 0,
                        loses: 0,
                    };
                    for(let i=0; i<data.rows.length; i++) {
                        if(data.rows[i].desc=="vitorias") answer.wins  = data.rows[i].valor;
                        if(data.rows[i].desc=="derrotas") answer.loses = data.rows[i].valor;
                    }
                    resolve(answer);
                });
            });
        });
    }
    static async getAchievements(callback) {
        let db = await this.database();
        return new Promise((resolve, reject) => {
            db.transaction((tx) => {
                tx.executeSql("SELECT id FROM `conquistas`", [], (tx, data) => resolve(data.rows));
            });
        });
    }
}